import React from 'react';

const ProjectsPage = () => {
  const projects = [
    {
      name: 'E-Commerce Website',
      description: 'A modern e-commerce platform featuring a seamless shopping experience with user authentication, product filtering, and a secure payment gateway.',
      techStack: ['React', 'Tailwind CSS', 'JavaScript', 'MySQL'],
      link: '#',
      bgColor: 'from-green-400 to-blue-300',
    },
    {
      name: 'Admin Dashboard',
      description: 'A dynamic admin dashboard offering real-time analytics, user management, and interactive data visualization.',
      techStack: ['HTML', 'CSS', 'JavaScript'],
      link: '#',
      bgColor: 'from-purple-400 to-pink-300',
    },
  ];

  return (
    <div className="min-h-screen flex flex-col bg-gradient-to-br from-gray-50 to-blue-50">
      {/* Navbar */}
      <nav className="bg-gradient-to-r from-blue-600 to-purple-600 text-white py-4 shadow-md">
        <div className="max-w-6xl mx-auto px-4 sm:px-6 lg:px-8 flex justify-between items-center">
          <a href="/" className="text-xl font-bold hover:text-blue-200 transition-colors">portfolio</a>
          <div className="flex gap-6">
            <a href="/about" className="hover:text-blue-200 transition-colors">About</a>
            <a href="#" className="hover:text-blue-200 transition-colors">Projects</a>
            <a href="/contact" className="hover:text-blue-200 transition-colors">Contact</a>
          </div>
        </div>
      </nav>

      {/* Main Content */}
      <div className="flex-grow">
        <div className="max-w-6xl mx-auto px-4 sm:px-6 lg:px-8 py-20">
          <h1 className="text-5xl font-bold text-center mb-12 bg-gradient-to-r from-blue-600 to-purple-600 text-transparent bg-clip-text">
            My Projects
          </h1>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
            {projects.map((project, index) => (
              <div
                key={index}
                className={`relative bg-white rounded-lg p-6 shadow-xl hover:shadow-2xl transition-all duration-300 group`}
              >
                <div
                  className={`absolute -inset-0.5 bg-gradient-to-r ${project.bgColor} rounded-lg blur opacity-25 group-hover:opacity-100 transition duration-1000 group-hover:duration-200`}
                ></div>
                <h2 className="text-2xl font-bold text-gray-900 mb-4">{project.name}</h2>
                <p className="text-gray-700 mb-4 leading-relaxed">{project.description}</p>
                <div className="mb-4">
                  <h3 className="font-semibold text-gray-800">Tech Stack:</h3>
                  <ul className="flex flex-wrap gap-2 mt-2">
                    {project.techStack.map((tech, i) => (
                      <li
                        key={i}
                        className="px-3 py-1 bg-gradient-to-r from-blue-100 to-purple-100 rounded-full text-gray-800 hover:from-blue-200 hover:to-purple-200 transition-colors"
                      >
                        {tech}
                      </li>
                    ))}
                  </ul>
                </div>
                <a
                  href={project.link}
                  className="inline-block px-4 py-2 bg-gradient-to-r from-blue-600 to-purple-600 text-white font-semibold rounded hover:from-blue-700 hover:to-purple-700 transition-colors"
                >
                  View Project
                </a>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Footer */}
      <footer className="bg-gradient-to-r from-gray-800 to-black text-white py-8">
        <div className="max-w-6xl mx-auto px-6">
          <div className="flex flex-col md:flex-row justify-between items-center gap-4">
            <div className="text-sm">
              Â© 2025 Jedidah Nzila. All rights reserved.
            </div>
            <div className="flex gap-6">
              <a href="/privacy" className="hover:text-blue-300 transition-colors">Privacy Policy</a>
              <a href="/terms" className="hover:text-blue-300 transition-colors">Terms of Service</a>
            </div>
          </div>
        </div>
      </footer>
    </div>
  );
};

export default ProjectsPage;
